import { useRef, useState } from "react";
import "../css/price-range.css";

const PriceRange = () => {
  const [value, setValue] = useState({ start: 0, end: 100 });
  const [startPos, setStartPos] = useState(0);
  const ref = useRef();
  const increaseStart = (e) => {
    console.log("moved");
    setStartPos(startPos + 1);
    ref.current.style.transform(startPos + "px");
    let newValue = value;
    newValue.start += 1;
    setValue(newValue);
  };

  return (
    <div className="slider-range d-flex">
      <div
        disabled
        ref={ref}
        onClick={() => increaseStart()}
        className="start-range"
      ></div>
      <div className="end-range"></div>
    </div>
  );
};

export default PriceRange;
